import React from 'react';
import './App.css';

function Box(props) {
  return (
    <div className="App">

        <button className="case red" onClick={() => this.props.changeColor("red")}></button>
        <button className="case yellow"onClick={() => this.props.changeColor("yellow")}></button>
        <button className="case blue"onClick={() => this.props.changeColor("blue")}></button>
        <button className="case green"onClick={() => this.props.changeColor("green")}></button>
        <button className="case purple"onClick={() => this.props.changeColor("purple")}></button>
    </div>
  );
}

export default Box;
